import React, { Component } from "react";
const InputForm = React.forwardRef((input) => (
    <form onSubmit={this.handleSubmit}>
        <input 
        type="text" 
        ref={input} 
        placeholder="enter task"/>
        <input 
        type="submit" 
        value="Add" />
    </form>
))

export default InputForm;
